description:
Электробритва, Шейвер VGR V-353.

Электробритва-компактная, бритва шейвер для окантовки и сухого бритья. Создана для поддержания гладкой кожи(сухое бритье щетины длинной до 2мм). Обеспечивает безопасное бритье, удобен в использовании. Также имеется встроенный триммер для подравнивания волосков. Мощный заряд позволит бриться несколько раз и не волноваться о поисках розетки.

Малые габариты экономят место и позволяют брать бритву с собой в любые поездки;

Выдвижной триммер;

Дорожная бритва;

Специальное покрытие корпуса невероятно приятное на ощупь.

Характеристики:

Время автономной работы 60-мин;

Время зарядки 8 часов;

Мощность 5вт;

Индикатор заряда и низкий заряд батареи;

Тип питания: от аккумулятора;

Материал лезвия: нержавеющая сталь;

Супер близкое к коже чистое бритье;

Использование: для лица, волос, тела, для коротких волос.

Материал корпуса: ABS пластик;

Система бритья: роторная;

Выдвижной триммер;

Напряжение 5 В постоянного тока;

Роторный мотор 6900 об/мин;

Аккумулятор Ni-Mh;

Размер: 100 х 58 х 24 мм;

Вес: 118 гр;

Комплектация:

Шейвер, кабель USB, защитная крышка, щетка, коробка.

Бритвы для женщин Venus Smooth — это первые бритвы с 3 лезвиями, созданные специально для женщин. Три повторяющих изгибы тела лезвия, окруженные разглаживающей полоской обеспечивают быстрое и надежное бритье. Голубая полоска-индикатор бледнеет, когда приходит время менять лезвия. Любая сменная кассета Venus подходит к любой бритвенной ручке Venus (кроме Simply Venus и Venus для зоны бикини).

надёжный дизайн: Срок службы бритвенных лезвий составляет до одного месяца (при бритье дважды в неделю). Когда будет необходимо, просто замените лезвие на новое;
быстро и просто: благодаря 3 встроенным лезвиям эта бритва обеспечивает быстрое и эффективное бритье. Качественное бритье — меньше движений;
экологичная ручка: обладает мягкой гелевой прослойкой, благодаря чему ручка удобно лежит в руках, и на 50% состоит из вторичного переработанного пластика;
гладкость и комфорт: 3 лезвия бритвы с легкостью обеспечивают гладкое и комфортное бритье
мягкое бритье: с защитными эластомерными подушечками вокруг лезвий для дополнительного комфорта
Любая сменная кассета Venus подходит к любой бритвенной ручке Venus (кроме Simply Venus и Venus для зоны бикини).
